import React from "react";
import { Fragment } from "react";
import { Container } from "react-bootstrap";

const Charts = () => {
  return (
    <Fragment>
      <Container
        fluid
        style={{
          padding: "30px",
        }}
      >
        <div>
          <h5 className="mb-3">Charts In React Js </h5>
        </div>
      </Container>
    </Fragment>
  );
};
export default Charts;
